function I = fcnK1S(S, T, u, alpha, F, tol)
t1 = 0.1e1 ./ u;t2 = 0.1e1 ./ T;t3 = t2 .* t1;t4 = sqrt(-u);t5 = F - t4;t6 = 0.1e1 ./ t5;t7 = t5 .^ 2;t8 = 0.2e1 .* t4;t10 = t5 .* (T + t8);t11 = t4 .* T;t13 = sqrt(t7 + t10 + t11);t14 = 0.1e1 ./ t13;t18 = u .^ 2;t20 = 0.1e1 ./ t18 .* t4;t24 = T .^ 2;t27 = 0.1e1 ./ (-t24 + 0.4e1 .* u);t28 = t27 .* t1;t32 = F .* t14 .* t27;t34 = t27 .* T;t40 = sqrt(t11);t41 = 0.1e1 ./ t40;t43 = 0.2e1 .* t11;t48 = log(t6 .* (0.2e1 .* t13 .* t40 + t10 + t43));t52 = 0.1e1 ./ t24;t53 = t52 .* t1;t56 = t1 .* t4;t57 = t27 .* t2;t61 = t52 .* t56;t67 = t14 .* t6 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.8e1 .* t14 .* t2 .* t20 - t14 .* t28 ./ 0.2e1 - t32 .* t3 + 0.3e1 ./ 0.8e1 .* t14 .* t34 .* t20 + 0.3e1 ./ 0.4e1 .* t32 .* t20 + 0.3e1 ./ 0.8e1 .* t48 .* t41 .* t2 .* t20 + 0.3e1 ./ 0.4e1 .* t14 .* t53 - 0.3e1 ./ 0.2e1 .* t14 .* t57 .* t56 - 0.3e1 .* t32 .* t61 - 0.3e1 ./ 0.4e1 .* t48 .* t41 .* t53;t68 = F + t4;t69 = 0.1e1 ./ t68;t70 = t68 .^ 2;t72 = t68 .* (T - t8);t74 = sqrt(t70 + t72 - t11);t75 = 0.1e1 ./ t74;t85 = F .* t75 .* t27;t92 = sqrt(-t11);t93 = 0.1e1 ./ t92;t99 = log(t69 .* (0.2e1 .* t74 .* t92 - t43 + t72));t113 = t75 .* t69 .* t3 ./ 0.4e1 + 0.3e1 ./ 0.8e1 .* t75 .* t2 .* t20 - t75 .* t28 ./ 0.2e1 - t85 .* t3 - 0.3e1 ./ 0.8e1 .* t75 .* t34 .* t20 - 0.3e1 ./ 0.4e1 .* t85 .* t20 - 0.3e1 ./ 0.8e1 .* t99 .* t93 .* t2 .* t20 + 0.3e1 ./ 0.4e1 .* t75 .* t53 + 0.3e1 ./ 0.2e1 .* t75 .* t57 .* t56 + 0.3e1 .* t85 .* t61 - 0.3e1 ./ 0.4e1 .* t99 .* t93 .* t53;t114 = t67 + t113;
I = t114(:,:,2) - t114(:,:,1);

end
